  document.getElementById("name").innerHTML = name;

  const Signout = async () => {
    const { logout } = useAuth();
    logout();
    navigate("/login");
  };

  return (
    <>
      <h1>
        Welcome <p id="name"></p>
      </h1>
      <div class="circle">
        <span class="innerTEXT"> Here a text</span>
      </div>{" "}
      <button onClick={Signout}>Sign out</button>
    </>
  );
};
